# Yanaul, Novoyanzigitovsky Selsoviet, Krasnokamsky District, Republic of Bashkortostan

}}
Yanaul (; , Yañawıl) is a rural locality (a village) in Novoyanzigitovsky Selsoviet, Krasnokamsky District, Bashkortostan, Russia. The population was 51 as of 2010.
Geography
It is located 46&nbsp;km from Nikolo-Beryozovka and 3&nbsp;km from Novy Yanzigit.
